pygame.display.set_caption('Cut up membrane')
pygame.font.init()

myfont = pygame.font.SysFont("monospace", 20)

clock = pygame.time.Clock()

#these are just draw functions
scale = 0.3
x_off = 1000
y_off = 600
def drawTriangle(colour, triangle, xoff=0, yoff=0):
    pygame.draw.polygon(screen, colour,
                       [[int(scale * (xoff + triangle[0][0])),int(scale * (yoff + triangle[0][1]))],
                        [int(scale * (xoff + triangle[1][0])),int(scale * (yoff + triangle[1][1]))],
                        [int(scale * (xoff + triangle[2][0])),int(scale * (yoff + triangle[2][1]))]],
                           1)

def drawPiece(Vertices, Triangles, organelles, x_off, y_off, colour):
	for v in Vertices:
		pygame.draw.circle(screen, colour, [int(scale*(v[0] + x_off)), int(scale*(v[1] + y_off))], 1)
	for t in Triangles:
		drawTriangle(colour, t, x_off, y_off)
	for o in organelles:
		pygame.draw.circle(screen, colour, [int(scale*(o[0] + x_off)), int(scale*(o[1] + y_off))], 5)

