def cut_up():
	#cut the array into 4 pieces
	global pieces_verts, pieces_triangles, pieces_organelles
	pieces_verts = [[],[],[],[]]
	pieces_triangles = [[],[],[],[]]
	pieces_organelles = [[],[],[],[]]

	#work out the boundaries of the quadrants
	quadrants = []
	jump = 0
	for i in range(3):
		jump += random.uniform(math.pi/4,2*math.pi/3)
		quadrants.append(max(-3*math.pi/4,math.pi - jump))

	#a function for finding which quadrant a point falls in
	def find_quadrant(point):
		angle = math.atan2(point[1],point[0])
		for i in range(3):
			if angle > quadrants[i]:
				return i
		return 3

	#for organlles and vertices put them in different quadrants
	for o in organelles:
		pieces_organelles[find_quadrant(o)].append(o)

	for v in Vertices:
		pieces_verts[find_quadrant(v)].append(v)

	#for triangles only include them if all points are in the same quadrant
	for t in Triangles:
		quads = []
		for p in t:
			quads.append(find_quadrant(p))
		if quads[0] == quads[1] and quads[1] == quads[2]:
			pieces_triangles[quads[0]].append(t)
			

